INSERT INTO vue_admin.elearning_list (course_id, title, description, price, admin_id,category) VALUES
	('1', 'La Face Cachée de l''économie Circulaire', 'Ce cours explore les aspects méconnus et les défis de l''économie circulaire, souvent perçue comme une solution idéale pour la durabilité. Il met en lumière les paradoxes de ce modèle, comme la surconsommation liée à la prolongation de la vie des produits et les effets pervers sur certaines chaînes de valeur. Le cours examine aussi les inégalités sociales et économiques, notamment l''accès aux ressources et aux emplois dans ce secteur. Les limites technologiques et logistiques du recyclage sont analysées, tout comme les difficultés de gouvernance liées à l''absence de normes mondiales. Enfin, il propose des pistes pour rendre l''économie circulaire plus inclusive, équitable et efficace.', '35', 77939440, 1),
	('2', 'Introduction à l''Économie Circulaire', 'Ce cours offre une introduction complète à l''économie circulaire, un modèle économique visant à réduire la consommation de ressources naturelles et la production de déchets en favorisant la réutilisation, la réparation, et le recyclage. Les étudiants exploreront les principes fondamentaux de l''économie circulaire, les différentes stratégies mises en place par les entreprises et les gouvernements pour la promouvoir, ainsi que ses avantages écologiques et économiques. Le cours met également en lumière les défis pratiques de la transition vers un modèle circulaire, notamment les barrières technologiques, sociales et réglementaires. Les étudiants auront ainsi une vision globale des opportunités et des limites de ce modèle pour le développement durable.', '20', 77939440, 1),
	('3', 'L''Importance du Recyclage pour un Avenir Durable', 'Ce cours aborde l''importance cruciale du recyclage dans la gestion des ressources naturelles et la réduction de l''impact environnemental des déchets. Les étudiants découvriront les principes fondamentaux du recyclage, ses différents types (recyclage des matériaux, des produits électroniques, etc.) et son rôle dans l''économie circulaire. Le cours mettra en évidence les bienfaits écologiques du recyclage, tels que la réduction de l''extraction des ressources, la diminution des émissions de gaz à effet de serre et la préservation de la biodiversité. En outre, il traitera des défis logistiques, économiques et sociaux du recyclage à grande échelle, tout en explorant les innovations technologiques qui rendent le recyclage plus efficace. L''objectif est de sensibiliser les étudiants à l''importance de cette pratique pour la transition vers une société plus durable et responsable.', '20', 77939440, 2),
	('4', 'Comment Green Circle Adopte une Démarche d''Économie Circulaire', 'Ce cours explore la manière dont Green Circle, une initiative engagée dans la durabilité, intègre les principes de l''économie circulaire dans ses pratiques. L''économie circulaire vise à maximiser la durée de vie des produits, à réduire les déchets et à recycler les matériaux afin de conserver les ressources naturelles. Green Circle adopte cette démarche en mettant en œuvre des stratégies concrètes de réduction des déchets, de réutilisation des matériaux et de recyclage, tout en sensibilisant les entreprises et les consommateurs à des pratiques plus responsables.', '20', 77939440, 4),
	('5', 'Les Enjeux de l''Économie Circulaire dans les Industries', 'Ce cours examine comment les industries peuvent adopter des pratiques d''économie circulaire pour réduire leur empreinte écologique tout en améliorant leur rentabilité. Les étudiants exploreront des études de cas réelles, mettant en avant des entreprises qui ont transformé leurs modèles commerciaux en intégrant des concepts tels que la récupération des matériaux, la conception durable et la logistique inverse. Le cours abordera également les défis spécifiques auxquels les grandes industries font face dans cette transition, ainsi que les opportunités d''innovation technologique et de partenariat stratégique.', '25', 77939440, 1),
    ('6', 'Stratégies pour un Modèle Circulaire dans les Entreprises', 'Ce cours propose un cadre stratégique pour aider les entreprises à passer d''un modèle économique linéaire à un modèle circulaire. Il explore les outils d''analyse des flux de matières, les modèles de revenus basés sur la réutilisation et la réparation, ainsi que les approches collaboratives avec les parties prenantes. En mettant l''accent sur les innovations disruptives, ce cours permet aux étudiants de comprendre comment concevoir et mettre en œuvre des stratégies circulaires qui favorisent la durabilité environnementale et économique.', '30', 77939440, 1),
	('7', 'Le Rôle des Entreprises dans la Transition Écologique', 'Ce cours met en lumière le rôle central des entreprises dans la transition vers une économie plus verte. Il explore comment les entreprises peuvent adopter des pratiques écologiques en réduisant leur empreinte carbone, en investissant dans des technologies vertes et en favorisant des chaînes d''approvisionnement durables. Les étudiants apprendront à évaluer l''impact environnemental des activités d''entreprise et à développer des stratégies visant à intégrer les objectifs de développement durable dans les opérations commerciales.', '30', 77939440, 2),
    ('8', 'La Responsabilité Sociétale des Entreprises (RSE) et son Impact', 'Ce cours explore la responsabilité sociétale des entreprises (RSE) et son impact sur la société et l''environnement. Les étudiants découvriront les principes de la RSE, les normes internationales, et les stratégies que les entreprises peuvent adopter pour répondre aux exigences écologiques et sociales tout en restant rentables. Le cours se concentrera également sur les méthodologies de reporting RSE et l''importance des partenariats pour atteindre les objectifs de durabilité.', '28', 77939440, 2),
    ('9', 'Greenwashing ou Véritables Pratiques Durables ?', 'Ce cours examine le phénomène du greenwashing, où les entreprises prétendent être plus écologiques qu''elles ne le sont réellement, et comment éviter cette pratique. Les étudiants apprendront à distinguer les vraies initiatives durables des actions purement marketing. Le cours met en lumière les enjeux éthiques et les solutions pour encourager des pratiques d''entreprise authentiquement écologiques, tout en explorant l''importance de la transparence et de la vérification des engagements environnementaux des entreprises.', '32', 77939440, 2),
	 ('10', 'Norme ISO 14001 : Gestion Environnementale pour la Durabilité', 'Ce cours explore la norme ISO 14001, qui établit les critères d’un système de gestion environnementale efficace. Il aide les entreprises à réduire leurs impacts environnementaux, à respecter les réglementations environnementales et à améliorer leur performance environnementale. Les étudiants apprendront à établir, mettre en œuvre et maintenir un système de gestion environnementale conforme à cette norme internationale.', '40', 77939440, 3),
    ('11', 'Norme ISO 14006 : Écoconception pour une Production Durable', 'Le cours ISO 14006 se concentre sur l’intégration de l’écoconception dans les processus de production, en réduisant l’impact environnemental des produits tout au long de leur cycle de vie. Il aborde les approches pratiques pour concevoir des produits plus écologiques, économes en ressources et moins polluants, tout en respectant les normes internationales de durabilité.', '38', 77939440, 3),
    ('12', 'La Norme ISO 50001 : Gestion de l''Énergie et Réduction des Émissions', 'Ce cours présente la norme ISO 50001, qui aide les entreprises à mettre en place un système de gestion de l’énergie afin de réduire leur consommation énergétique et leurs émissions de gaz à effet de serre. Les étudiants apprendront les meilleures pratiques pour améliorer l’efficacité énergétique et adopter des comportements plus responsables vis-à-vis de l’environnement.', '45', 77939440, 3),
    ('13', 'Réglementations Européennes et Écologie : Compliance et Pratiques Durables', 'Ce cours explore les principales réglementations environnementales européennes, telles que REACH, la directive sur les émissions industrielles, et la gestion des déchets. Les étudiants apprendront comment se conformer à ces normes écologiques, tout en adoptant des stratégies durables qui permettent aux entreprises de minimiser leur empreinte écologique et d’optimiser leur conformité réglementaire.', '42', 77939440, 3),
	('14', 'Responsabilité Sociétale : Intégration des ODD', 'Ce cours aborde les principes de la gouvernance d’entreprise en tenant compte des enjeux environnementaux et sociaux, en particulier les Objectifs de Développement Durable (ODD). Les étudiants apprendront comment intégrer les préoccupations écologiques dans les stratégies de gestion et de prise de décision des entreprises, tout en respectant les normes de gouvernance et en améliorant leur impact social et environnemental.', '50', 77939440, 4),
    ('15', 'Gestion des Risques Environnementaux : Gouvernance et Conformité', 'Ce cours explore la gestion des risques environnementaux dans un cadre de gouvernance d’entreprise. Il enseigne comment identifier, évaluer et minimiser les risques écologiques, tout en garantissant la conformité avec les régulations environnementales. Les étudiants découvriront des stratégies pour intégrer la gestion des risques écologiques dans les processus décisionnels d’entreprise.', '48', 77939440, 4),
    ('16', 'Stratégies de Gouvernance pour une Transition Écologique Durable', 'Ce cours se concentre sur les stratégies de gouvernance d’entreprise pour réussir une transition écologique durable. Les étudiants apprendront à définir des objectifs écologiques à long terme, à structurer des politiques environnementales efficaces et à encourager la responsabilité écologique au sein des entreprises. L’accent sera mis sur la mise en œuvre de pratiques durables tout en respectant les impératifs économiques et sociaux.', '52', 77939440, 4);


